import React from 'react';


function Header() {
  return (
    <header id="header" className="alt">
    <a href="index.html" className="logo"><strong>Forty</strong> <span>by HTML5 UP</span></a>
    <nav>
        <a href="#menu">Menu</a>
    </nav>
</header>
  );
}

export default Header;
